import React from 'react';
import './App.css';
import Dashboard from './components/Dashboard'
import MarkdownFile from './components/MarkdownFile'
import Module from './content/module1.2.md';
import {BrowserRouter } from 'react-router-dom'
function App() {
  return (
    <BrowserRouter>
    <div>
      <Dashboard>
        <MarkdownFile props={Module}/>
      </Dashboard>
    </div>
    </BrowserRouter>
  )}

export default App;
